    Parking1: {
      hour: 500,
      shift: 2000, 
      noon: 3500, 
      fullDay: 5000,
    },
    Parking2: {
      hour: 600,
      shift: 2500,
      noon: 4000,
      fullDay: 6000,
    },
    Parking3: {
      hour: 400,
      shift: 1800,
      noon: 3000,
      fullDay: 4500,
    },
  };

  const calculateTotalPrice = () => {
    const selectedPrice = prices[parkingOption];

    switch (hoursOption) {
      case '1':
        return selectedPrice.hour;
      case 'turno':
        return selectedPrice.shift;
      case 'medio-dia':
        return selectedPrice.noon;
      case 'dia-completo':
        return selectedPrice.fullDay;
      default:
        return 0;
    }
  };

