        Swal.fire({
            icon: 'success',
            title: 'Reserva correcta',
            showConfirmButton: false,
            timer: 1800
        })
        navigate('/reserves')
    } catch (error) {
        console.log(error)
    }
    };

    const calculateEndTime = () => {
      const currentTime = new Date();
      const durationInHours = parseFloat(hoursOption); // Convertir a n√∫mero
      const endTime = new Date(currentTime.getTime() + durationInHours * 60 * 60 * 1000); // Calcular endTime
      return endTime.toLocaleTimeString();
    };



  return (
    <div className="container" style={{ width: '50%', marginTop: '50px' }}>
      <div style={{ textAlign: 'center' }}>
          <h1>Confirmaci√≥n de Reserva</h1>
          <div style={{ width: '100%', backgroundColor: '#F5B041', height: '5px', margin: 'auto', marginBottom: '20px' }}></div>
      </div>
      <form>
        <div className="mb-3" style={{ marginTop: '50px' }}>
          <label htmlFor="parkingOption" className="form-label">
            <h4>Parking</h4>
          </label>
          <select
            className="form-select"
            id="parkingOption"
            name="parkingOption"
            value={parkingOption}
            onChange={handleParkingChange}
          >
            <option value="Parking1">Parking San Mart√≠n</option>
            <option value="Parking2">Parking Francia</option>
            <option value="Parking3">Parking Plaza Espa√±a</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="hoursOption" className="form-label">
            <h4>Seleccione la duraci√≥n</h4>
          </label>
          <select
            className="form-select"
            id="hoursOption"
            name="hoursOption"
            value={hoursOption}
            onChange={handleHoursChange}
          >
            <option value="1">1 hora</option>
            <option value="turno">Turno (4 horas)</option>
            <option value="medio-dia">Medio d√≠a (12 horas)</option>
            <option value="dia-completo">D√≠a completo(24 horas)</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="totalPrice" className="form-label">
            <h4>Precio Total</h4>
          </label>
          <input
            type="text"
            className="form-control"
            id="totalPrice"
            name="totalPrice"
            value={`$${calculateTotalPrice()}`} 
            readOnly
          />
        </div>
        <div style={{ textAlign: 'center' }}>
          <button
            type="button"
            className="btn btn-warning text-white"
            onClick={handleConfirmReservation}
          >
            Confirmar Reserva
          </button>
        </div>
      </form>
    </div>
  );
};

export default ConfirmationReserve;
